import React from "react";
import ReactDOM from "react";

class ProfileLink extends React.Component {
    render() {
      return (
        <div>
          <a href={this.props.url} 
          title={this.props.title}
          target="_top">Profile
          </a>
        </div>
      )
    }
  } 

export default ProfileLink;
